namespace Sigma.NET

module Globals =

    open DynamicObj
    open System.Runtime.InteropServices
    open Newtonsoft.Json

    /// <summary>
    /// The NuGet package version for Sigma.NET.
    /// </summary>
    [<Literal>]
    let NUGET_VERSION = "0.0.0-dev"
    
    /// <summary>
    /// The version of the Graphology library used in the project.
    /// </summary>
    [<Literal>]
    let GRAPHOLOGY_LIB_VERSION = "0.8.0"

    /// <summary>
    /// The sigma.js version loaded from the CDN in rendered HTML docs.
    /// </summary>
    [<Literal>]
    let SIGMAJS_VERSION = "2.4.0"

    /// <summary>
    /// The graphology.js version loaded from the CDN in rendered HTML docs.
    /// </summary>
    [<Literal>]
    let GRAPHOLOGY_VERSION = "0.25.4"

    /// <summary>
    /// JavaScript template for rendering the graph. 
    /// It includes placeholders for container ID, graph data, layout, settings, and widgets.
    /// </summary>
    [<Literal>]
    let SCRIPT_TEMPLATE = """
    const container = document.getElementById("[CONTAINERID]");
    const graph = new graphology.Graph();
    graph.import([GRAPHDATA]);
    [LAYOUT]
    const renderer = new Sigma(graph, container,[SETTINGS]);
    [WIDGETS]
    """

    /// <summary>
    /// JavaScript template for rendering the graph using RequireJS. 
    /// It includes placeholders for JavaScript file URLs, container ID, graph data, layout, settings, and widgets.
    /// </summary>
    [<Literal>]
    let REQUIREJS_SCRIPT_TEMPLATE = """

    require([
        '[GRAPHOLOGY_JS]',
        '[SIGMA_JS]',
        '[GRAPHOLOGY-LIB_JS]',
    ], (graphology,_,graphologyLibrary)=>{          
            const container = document.getElementById("[CONTAINERID]");
            const graph = new graphology.Graph();
            graph.import([GRAPHDATA]);
            [LAYOUT]  
            const renderer = new Sigma(graph, container,[SETTINGS]);
            [WIDGETS]        
        });
    """


    /// <summary>
    /// Base64 encoded favicon logo for generated HTML files.
    /// </summary>
    [<Literal>]
    let internal LOGO_BASE64 = """"""

    /// Configuration settings for JSON serialization with specific handling for reference loops.
    let internal JSON_CONFIG =
        JsonSerializerSettings(ReferenceLoopHandling = ReferenceLoopHandling.Serialize)